## Tooltip

A tooltip is a small box of information that appears when a user hovers over an element. It is a great way to provide additional information without cluttering the user interface.

## React Context

React Context is a way to pass data down the component tree without having to pass props down manually at every level. It is a great way to share state and functions between components that are not directly related.

## Creating a Tooltip

To create a Tooltip in NextJS using React Context, we will first need to create a new React Context. This can be done by calling the `createContext` function from the `react` package.

```
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

export default TooltipContext;
```

Next, we will need to create a new component that will use this context. This component will be responsible for rendering the Tooltip and handling the logic for showing and hiding it.

```
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, content, position }) => {
  const { tooltip, setTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    setTooltip({
      content,
      position,
      show: true,
    });
  };

  const handleMouseLeave = () => {
    setTooltip({
      show: false,
    });
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {tooltip.show && (
        <div
          className={`tooltip ${tooltip.position}`}
          style={{
            left: tooltip.position === 'left' ? '-50%' : '100%',
            top: '-50%',
          }}
        >
          {tooltip.content}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

In this component, we are using the `useContext` hook to access the `tooltip` state and the `setTooltip` function from the `TooltipContext`. We are also defining two event handlers, `handleMouseEnter` and `handleMouseLeave`, which will be used to show and hide the Tooltip.

The `handleMouseEnter` function is called when the user hovers over the element, and it sets the `tooltip` state to show the Tooltip with the given content and position. The `handleMouseLeave` function is called when the user moves the cursor away from the element, and it sets the `tooltip` state to hide the Tooltip.

Finally, we are rendering the Tooltip by checking the `tooltip.show` property. If it is `true`, we are rendering the Tooltip with the given content and position.

## Using the Tooltip

To use the Tooltip, we will need to wrap our application in the `TooltipProvider` component, which will provide the `tooltip` state and the `setTooltip` function to all the components in the tree.

```
import React, { useState } from 'react';
import TooltipContext from './TooltipContext';
import Tooltip from './Tooltip';

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState({
    show: false,
  });

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
      <Tooltip />
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```

